import React from 'react';
import { Link } from 'react-router-dom';

const Header: React.FC = () => {
    return (
        <header>
            <h1>Task Manager</h1>
            <nav>
                <Link to="/">Home</Link>
                <Link to="/tasks">Tasks</Link>
                <Link to="/login">Login</Link>
            </nav>
        </header>
    );
};

export default Header;
